import React from 'react';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar></NavBar>
      </header>
      <div className="App-Body">
        <p>Pretend there is something here.</p>
      </div>
    </div>
  );
}

export default App;
